import React, { useState, useEffect } from 'react';
import { useHistory } from 'react-router-dom';
import axios from 'axios';

const Dashboard = () => {
  const [userData, setUserData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [services, setServices] = useState([]);
  const [booking, setBooking] = useState({ service: '', location: '', date: '' });
  const history = useHistory();

  // Fetch user data and available services after login
  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          history.push('/login'); // Redirect to login if not authenticated
          return;
        }

        // Fetch user data
        const userResponse = await axios.get('/dashboard', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setUserData(userResponse.data);

        // Fetch available services (e.g., technicians)
        const servicesResponse = await axios.get('/services', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setServices(servicesResponse.data);
      } catch (err) {
        setError('Failed to fetch user data or services');
        console.error(err);
      } finally {
        setIsLoading(false);
      }
    };

    fetchUserData();
  }, [history]);

  // Log out and clear local storage
  const handleLogout = () => {
    localStorage.removeItem('token');
    history.push('/login');
  };

  // Delete account
  const handleDeleteAccount = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        history.push('/login');
        return;
      }

      await axios.delete('/delete-account', {
        headers: { Authorization: `Bearer ${token}` },
      });

      localStorage.removeItem('token');
      history.push('/login');
    } catch (err) {
      setError('Failed to delete account');
      console.error(err);
    }
  };

  // Handle booking submission
  const handleBookingChange = (e) => {
    const { name, value } = e.target;
    setBooking((prevBooking) => ({ ...prevBooking, [name]: value }));
  };

  const handleBookingSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        history.push('/login');
        return;
      }

      // Assuming booking is posted to the '/book' endpoint
      await axios.post(
        '/book',
        { ...booking },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      alert('Booking successful!');
      setBooking({ service: '', location: '', date: '' }); // Reset form
    } catch (err) {
      setError('Failed to make booking');
      console.error(err);
    }
  };

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div>
      <h1>Welcome, {userData.message}</h1>
      <button onClick={handleLogout}>Log Out</button>
      <button onClick={handleDeleteAccount}>Delete Account</button>

      {/* Booking Form for Customers */}
      <div>
        <h2>Make a Booking</h2>
        <form onSubmit={handleBookingSubmit}>
          <div>
            <label htmlFor="service">Service:</label>
            <select
              id="service"
              name="service"
              value={booking.service}
              onChange={handleBookingChange}
              required
            >
              <option value="">Select Service</option>
              {services.map((service) => (
                <option key={service.id} value={service.id}>
                  {service.name}
                </option>
              ))}
            </select>
          </div>
          <div>
            <label htmlFor="location">Location:</label>
            <input
              type="text"
              id="location"
              name="location"
              value={booking.location}
              onChange={handleBookingChange}
              required
            />
          </div>
          <div>
            <label htmlFor="date">Date:</label>
            <input
              type="date"
              id="date"
              name="date"
              value={booking.date}
              onChange={handleBookingChange}
              required
            />
          </div>
          <button type="submit">Submit Booking</button>
        </form>
      </div>
    </div>
  );
};

export default Dashboard;
